    false,nt"url": null,nt"notes": "There is an EJ Index for each environmental
    indicator. There are 12 EJ Indexes in EJSCREEN reflecting the 12 environmental indicators.
    The EJ Index names are: Particulate Matter (PM2.5), Ozone, NATA Diesel PM, NATA
    Cancer Risk, NATA Neuro HI, NATA Respiratory HI, Traffic Proximity and Volume, Lead
    Paint Indicator, Proximity to Risk Management Plan Sites, Proximity to National
    Priorities List Sites, Proximity to Treatment Storage and Disposal Facilities, and
    Proximity to Major Direct Water Dischargers. The EJ index is constructed as follows:
    EJ Index = (Environmental Indicator) * (Demographic Index for Block Group - Demographic
    Index for U.S.) * (Block Group Population)",nt"license_title": null,nt"extras":
